import React from 'react';
import './ReportsLayout.css';

const ReportsLayout = () => {
  const reportsData = [
    { id: 1, reportName: 'Annual Sales Report', date: '2024-01-15', status: 'Completed' },
    { id: 2, reportName: 'Q1 Financial Overview', date: '2024-02-10', status: 'In Progress' },
    { id: 3, reportName: 'Customer Feedback Summary', date: '2024-03-05', status: 'Completed' },
  ];

  return (
    <div className="reports-layout">
      <h2>Your Reports</h2>
      <table className="reports-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Report Name</th>
            <th>Date</th>
            <th>Status</th>
          </tr>
        </thead>
        <tbody>
          {reportsData.map(report => (
            <tr key={report.id}>
              <td>{report.id}</td>
              <td>{report.reportName}</td>
              <td>{report.date}</td>
              <td>{report.status}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ReportsLayout;
